          <p style={{
            fontFamily: 'TT Firs Neue-300',
            fontSize: 20,
            color: '#fff',
            marginTop: '1rem'
          }}>
            2024 © Все права защищены
          </p>
        </div>
        <img src={require('../assets/icon.png')} style={{
            float: 'right',
            marginTop: '8rem'
        }}/>
      </div>
    </footer>
    </>
  )
}
